import React from "react";
import "./Projects.css";
import Quote from "./component/codes";

const Project = (props) => {
const detail = [
{
image: "",
name: "website",
description: "",
techStacks: "",
link: "",
},
{
image: "",
name: "website",
description: "",
techStacks: "",
link: "",
},
{
image: "",
name: "website",
description: "",
techStacks: "",
link: "",
},
{
image: "",
name: "website",
description: "",
techStacks: "",
link: "",
},
{
image: "",
name: "website",
description: "",
techStacks: "",
link: "",
},
{
image: "",
name: "website",
description: "",
techStacks: "",
link: "",
}
]
return (
<section id="Projects">
<div className="Projectpaper">
<h3>Websites</h3>
<p></p>
</div>
<div className="print">
{detail.map((project, id) => (
<Quote
key={id}
image={project.image}
name={project.name}
description={project.description}
techStacks={project.techStacks}
link={project.link}
/>
))}
</div>


</section>
)
}

export default Project;
